import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to be present
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Wait for at least one product card to appear
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click the first product card to open the Product Detail Modal
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) {
      throw new Error('No product cards found');
    }
    await productCards[0].click();

    // Wait for the modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });

    // Wait for the product detail content to load inside the modal
    await page.waitForSelector('#productDetail', { timeout: 5000 });

    // Take screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_open.png'));

    // Extract product title from the modal
    const productTitle = await page.$eval('#productDetail .product-detail-title', el => el.textContent.trim());

    // Extract product price from the modal
    const productPrice = await page.$eval('#productDetail .product-detail-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened the Product Detail Modal for the first product and extracted its title and price",
      extractedData: {
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
